{
    "sql-query": "SELECT rm_code AS Id,rm_code,rm_description,rm_grade,rm_Colour FROM rm_details where ActiveStatus = 'Active' and rm_code like '%' and rm_description like '%' and rm_grade like '%'  group by rm_code,rm_description,rm_grade,rm_Colour limit 10 offset 10;",
