}

{
    "sql-query": "SELECT distinct smp.Id, smp.Part_name,smp.Part_number,smp.Raw_material_name,smp.Machine_no,smp.Prepared_by,smp.Approved_by,prepared_by_details.emp_name AS Prepared_by_name, approved_by_details.emp_name AS Approved_by_name, rm_details.rm_description AS Rm_name FROM production_smp_parent smp LEFT JOIN  emp_details AS prepared_by_details ON smp.Prepared_by = prepared_by_details.emp_code LEFT JOIN  emp_details AS approved_by_details ON smp.Approved_by = approved_by_details.emp_code  LEFT JOIN  rm_details ON smp.Raw_material_name = rm_details.rm_code where smp.ActiveStatus = 1  order by smp.Id DESC limit 10 offset 0;",
    "sql-query-params": []
}

{
    "sql-query": "SELECT distinct pms.id as Id,pms.TrackDate, md.mc_code, md.mc_mac_bay, IFNULL(tm.Track_7_am,'') as Track_7_am, IFNULL(tm.Track_11_am,'') as Track_11_am, IFNULL(tm.Track_15_pm,'') as Track_15_pm, IFNULL(tm.Track_19_pm,'') as Track_19_pm, IFNULL(tm.Track_23_pm,'') as Track_23_pm, IFNULL(tm.Track_3_am,'') as Track_3_am from pro_mon_sys_parent pms right join machine_details md on md.mc_code = pms.Mcno and pms.ActiveStatus='1' and pms.CreatedDate BETWEEN '2024-07-01 08:00:00' and '2024-07-25 08:00:00'  left join pro_mon_sys_tracking_machine tm on pms.Id = tm.Pms_id and tm.Time_to_be_updated='Part name' where 1 = 1  and md.mc_mac_bay like '%' and md.mc_code like '%'  order by md.mc_mac_bay,md.mc_code limit 20 offset 20;",
    "sql-query-params": []
}

